INSERT INTO appgroup (id, name, description) VALUES ('super-group-id', 'Super group', 'This is a group of users that has right in anything. It is used in developement. In production must be removed.');
INSERT INTO appgroup (id, name, description) VALUES ('ff94bfad-7079-41ea-bf4b-6962e36cad1f', 'Test Classifications', NULL);
INSERT INTO appgroup (id, name, description) VALUES ('CommunityRecorders', 'Community recorders', 'Community recorders users, who can submit claims');
INSERT INTO appgroup (id, name, description) VALUES ('claim-moderators', 'Claim moderators', 'Group for users who can moderate claims, submitted by community recorders');
INSERT INTO appgroup (id, name, description) VALUES ('claim-reviewers', 'Claim reviewers', 'Claim reviewers');
INSERT INTO appgroup (id, name, description) VALUES ('CommunityMembers', 'Community members', 'Community memebers, who can view claims');
INSERT INTO appgroup (id, name, description) VALUES ('10', 'Administrator', 'SOLA Support Staff. Users assigned this role have the ability to configure and administer the SOLA application. E.g. Add users, configure roles, update system codes, edit business rules etc.');
INSERT INTO appgroup (id, name, description) VALUES ('20', 'Search and View CofO Information', 'Allows users to search and view property information. All Deeds Registry and SG GIS staff have this role by default. Other staff (Technical, Accounts, etc) can be assigned this role as required.');
INSERT INTO appgroup (id, name, description) VALUES ('30', 'Search and View Only', 'Allows users to search and view application and document details as well as the Map. Printing documents, map or application details is not permitted');
INSERT INTO appgroup (id, name, description) VALUES ('40', 'Team Leader', 'Team Leaders (including Director Lands and Deeds) can approve applications, re-assign applications to other staff and generate lodgement reports. This role should be combined with the appropriate staff role (e.g. Deeds Registry or SG GIS so that the team leader has access suitable for their section.');
INSERT INTO appgroup (id, name, description) VALUES ('60', 'Deeds Registry', 'The Deeds Registry staff. Users assigned this role can lodge and edit registration applications as well as generate Certificates of Occupancy.');
INSERT INTO appgroup (id, name, description) VALUES ('70', 'SG GIS', 'The SG GIS Staff of the Technical Division. Users assigned this role can lodge and edit applications to process survey plans as well as view CofO information.  They cannot generate Certificates of Occupancy.');
